import React from 'react';

const AdminPortal = () => {
  return (
    <div className="min-h-screen flex items-center justify-center bg-background text-foreground">
      <h1 className="text-4xl font-bold">Welcome to Admin Portal</h1>
    </div>
  );
};

export default AdminPortal;
